webpackJsonp([24489777881196],{362:function(n,e){n.exports={data:{markdownRemark:{html:'<p><strong>We provide custom training services for <span class="font__highlight">individuals</span></strong> who need a personal trainer/coach/mentor. Our goal is to make you excellent at building software solutions.</p>\n<h3>Criteria for acceptance</h3>\n<ul>\n<li>You\'ve been a developer for a <strong>solid</strong> 6 months or longer.</li>\n<li>You\'re comfortable writing in JavaScript.</li>\n</ul>\n<h3>Length of training</h3>\n<ul>\n<li>You pay, we teach. It\'s up to you how long you need us.</li>\n</ul>\n<h3>Current training offerings</h3>\n<p><strong><span class="font__highlight">We\'re currently training on front-end development using JavaScript.</span></strong></p>\n<p>This is a pilot program (we\'re a startup) and there are still things to work out. Since we value flexibility, we expect the length to be as you need.</p>\n<h3>"I\'m interested, where do I start?"</h3>\n<p><strong>Contact us. We\'ll have tea/coffee and chat about what training could look like for you.</strong></p>\n<p>Phone: <a href="tel:+9779808302870">+977 980 830 2870</a>\n<br />\nEmail: <a href="mailto:hello@codeleadgrow.com?subject=Training inquiry">hello@codeleadgrow.com</a></p>\n<p>Any questions about <span class="font__highlight">cost</span>, <span class="font__highlight">hours</span>, <span class="font__highlight">curriculum</span> (etc.)? We will answer them all at our introductory meeting.</p>',frontmatter:{title:"Training for developers",path:"/training",excerpt:null}}},pathContext:{}}}});
